('90','2','15','编码转换相关','ASCII码转换|ASCIImazhuanhuan|3-r-0-180','','<script language=\"javascript\" type=\"text/javascript\"> 
<!-- 
function decode(){ 
  if($(\'hex\').value != \'\'){ 
        var vText = $(\'hex\').value; 
        $(\'ascii\').value = unescape(vText); 
  } 
} 
function encode(){ 
  if($(\'ascii\').value != \'\'){ 
     var vText = $(\'ascii\').value; 
     $(\'hex\').value = convertToHex(vText); 
         var vEncoded = convertToUnicode(vText); 
     $(\'unicode\').value = vEncoded; 
         $(\'unicodeHTML\').innerHTML = vEncoded;
 	$(\'ascii\').focus();
	$(\'ascii\').blur();
	$(\'ascii\').select();
  } 
} 
function convertToUnicode(source) { 
  result = \'\'; 
  for (i=0; i<source.length; i++) 
    result += \'&#\' + source.charCodeAt(i) + \';\'; 
  return result; 
} 
               
function convertToHex(num) { 
  var hex = \'\'; 
  for (i=0;i<num.length;i++) 
    hex += \"%\" + num.charCodeAt(i).toString(16).toUpperCase(); 
  return hex; 
} 
/* ************************************************* */
function convertToASCII() {
	if ($(\'unicode\').value != \'\') {
		var uniText = $(\'unicode\').value;
		var testText = uniText.substring(2,uniText.length-1).split(\";&#\")
		var resultString = \"\"
		for (i=0;i<testText.length;i++)
			resultString += \"%\" + dec2hex(testText[i])
		$(\'ascii\').value = unescape(resultString);
	}
}
function dec2hex(n){
var hex = \"0123456789ABCDEF\";
var mask = 0xf;
var retstr = \"\";
	while(n != 0){
		retstr = hex.charAt(n&mask) + retstr;
		n>>>=4;
	}
 return retstr.length == 0 ? \"0\" : retstr;
}
/* ************************************************* */
//--> 
</script>
<center>
