('91','2','15','加密解密相关','Encode加密UnEncode解密|EncodejiamiUnEncodejiemi|3-r-0-180','','<script type=\"text/javascript\">
function Encode()
{
    var con=document.getElementById(\"content\").value;
    document.getElementById(\"content\").value=UrlEncode(con);
}
function UrlEncode(str){ 
   var ret=\"\"; 
   var strSpecial=\"!\"#$%&\'()*+,/:;<=>?[]^`{|}~%\"; 
   for(var i=0;i<str.length;i++){ 
   var chr = str.charAt(i); 
     var c=str2asc(chr); 
     if(parseInt(\"0x\"+c) > 0x7f){ 
       ret+=\"%\"+c.slice(0,2)+\"%\"+c.slice(-2); 
     }else{ 
       if(chr==\" \") 
         ret+=\"+\"; 
       else if(strSpecial.indexOf(chr)!=-1) 
         ret+=\"%\"+c.toString(16); 
       else 
         ret+=chr; 
     } 
   } 
   return ret; 
}
 
function UnEncode()
{
   var con=document.getElementById(\"content\").value;
   document.getElementById(\"content\").value=UrlDecode(con);
} 
 
function UrlDecode(str){ 
   var ret=\"\"; 
   for(var i=0;i<str.length;i++){ 
   var chr = str.charAt(i); 
     if(chr == \"+\"){ 
       ret+=\" \"; 
     }else if(chr==\"%\"){ 
     var asc = str.substring(i+1,i+3); 
     if(parseInt(\"0x\"+asc)>0x7f){ 
       ret+=asc2str(parseInt(\"0x\"+asc+str.substring(i+4,i+6))); 
       i+=5; 
     }else{ 
       ret+=asc2str(parseInt(\"0x\"+asc)); 
       i+=2; 
     } 
     }else{ 
       ret+= chr; 
     } 
   } 
   return ret; 
} 
</script>
<script language=\"VBScript\" type=\"text/vbscript\"> 
Function str2asc(strstr) 
str2asc = hex(asc(strstr)) 
End Function 
Function asc2str(ascasc) 
asc2str = chr(ascasc) 
End Function 
</script>
<center><h1>把代码以Encode加密/UnEncode解密</h1>
<P>提示：由于兼容性问题，此转换功能只能在IE中使用，FIREFOX无效</P>
  <textarea name=\"textarea\" rows=\"15\" cols=\"80\" id=\"content\"></textarea><br /><br />
  <button name=\"button\" type=\"button\" onclick=\"Encode();\">Encode加密</button>
  <button name=\"button\" type=\"button\" onclick=\"UnEncode();\">UnEncode解密</button>
</center>',''),
